       const params = {
           email: localStorage.getItem('loggedInStudent')

       }
        axios.get('http://localhost:8080/findByEmail',{params})
        .then(response => {
            this.setState(
                {
                    student: response.data
                }
            )
        })


    }

    render() {

        return (
            <ImageBackground source={'/Users/Danny/Documents/Capstone/student-portal2/src/images/img1.jpeg'} style={{width: '100%', height: '100%'}}>

            <div className="site-wrapper">


                       <br></br>
                        <h1 className="container-center">{this.state.student.firstName}'s Profile
